import React from 'react';
import './global.css';
import './App.css';
import './Sidebar.css';

// Componente: Bloco isolado o qual não interfere no restante da aplicação. É uma função que retorna um conteúdo HTML, CSS ou JS
// Propriedade: São os atributos de um componente. Ex.: title, id, class. Informações que um componente PAI passa para o componente FILHO
// Estado: Informações mantidas pelo componente (Lembrar do conceito imutabilidade). {useState}

function App() {
  return (
    <div id="app">
      <aside>
        <strong>Cadastrar</strong>
        <form>
          <div class="input-block">
            <label htmlFor="github_username">Usuário do Github</label>
            <input id="github_username" name="github_username" required></input>
          </div>

          <div class="input-block">
            <label htmlFor="techs">Tecnologias</label>
            <input id="techs" name="techs" required></input>
          </div>


          <div className="input-group">
            <div class="input-block">
              <label htmlFor="Latitude">Latitude</label>
              <input id="Latitude" name="Latitude" required></input>
            </div>

            <div class="input-block">
              <label htmlFor="Longitude">Longitude</label>
              <input id="Longitude" name="Longitude" required></input>
            </div>
          </div>

          <button type="submit">Salvar </button>

        </form>
      </aside>

      <main>
        <ul>

        </ul>
      </main>

    </div>
  );
}

export default App;
